(1, '9th International Congress of Oral Implantology', 'CONFERENCE', 'AOI has provided a platform where major implant companies have been able to introduce their products to common audience and the participants have also benefited by comparing various implant systems and attending hands on sessions of all the systems. The patronage of our supporters and well wishers has been immensely encouraging, without whose favorable response our goals would have remained dreams.', '', '2017-06-02', '2017-06-04', '', '', '<table border="1" width="" cellspacing="0" cellpadding="5">\n<tbody>\n<tr>\n<td width="">Category</td>\n<td width="">From 1st Nov&rsquo; 16 to 30th Apr 17</td>\n<td width="">From 1st May to 25th Aug 17</td>\n<td width="">Spot Registration</td>\n</tr>\n<tr>\n<td>Student Delegate</td>\n<td>Rs.9,000/-</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,500/-</td>\n</tr>\n<tr>\n<td>Faculty / Delegate</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,000/-</td>\n<td>Rs.11,000/-</td>\n</tr>\n<tr>\n<td>Accmp. Person (Above 5 yrs)</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n</tr>\n<tr>\n<td>International Delegate</td>\n<td>USD 450</td>\n<td>USD 500</td>\n<td>USD 550</td>\n</tr>\n</tbody>\n</table>\n<p style="font-family: myfont; font-size: 18px;"><a href="http://www.pedosphere.in/register" target=_blank>Register Here</a></p>\n', '<p style="font-family: myfont; font-size: 18px;">Dr. Ajay Sharma</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919810061863">+91 9810061863</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:info@aoi-india.org">info@aoi-india.org</a></p>', '', '<a href="geo:28.6177712,77.2162896?q=28.6177712,77.2162896(LE MERIDIAN),z=18">Hotel le meridian</a>', 'New Delhi', '28.6177712', '77.2162896', 1),
(2, '19th Indian Prosthodontics Society PG Convention', 'CONFERENCE', 'IPS planned scientific sessions, keynote speeches, preconvention courses and one-on-one sessions will undoubtedly be the source of knowledge & opportunity to post graduate students to update their knowledge and skills. The theme of the convention “Capabilities with Values” aptly signifies that now these days in prosthodontics pressure is to innovate and reinvent at the breakneck speed. But sometimes it is worth going back to the basics and reassess core values, strengths and capabilities.', '', '2017-06-16', '2017-06-18', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="&nbsphttp://www.19thipspgconvention.com/registrationdetails.html" target=_blank>Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Dr. Varun Kumar</p>\n<p style="font-family: myfont; font-size: 18px;">Organising Secretary</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+917055565065">+91 7055565065</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:19thipspg@gmail.com">19thipspg@gmail.com</a></p>', '', '<a href="geo:30.069252,78.277261?q=30.069252,78.277261(SEEMA DENTAL COLLEGE),z=18">Seema Dental College and Hospital</a>', 'Rishikesh', '30.069252', '78.277261', 1),
(3, '26th annual conference of the IAACD', 'CONFERENCE', 'The IAACD has put Aesthetic Dentistry on the face of Indian Dentistry and is today the only body in India to keep this flag flying high. The annual conference is the show piece of the IAACD and every year brings the newest and latest in aesthetic dentistry and gift wraps it to bring to your lap the ultimate experience in aesthetic procedures and techniques. This year we are striving to hone your fine skills and move forward with all the delegates to high levels of aesthetics and end results which would make even and every one of the attending participant take home clinical aspects which can be immediately implemented and enhace the quality of Aesthetics in the clinical dentistry extensively.\n\n', '', '2017-08-04', '2017-08-06', '', '', '<table border="1" width="" cellspacing="0" cellpadding="5">\n<tbody>\n<tr>\n<td width="">Category</td>\n<td width="">From 1st Nov&rsquo; 16 to 30th Apr 17</td>\n<td width="">From 1st May to 25th Aug 17</td>\n<td width="">Spot Registration</td>\n</tr>\n<tr>\n<td>Student Delegate</td>\n<td>Rs.9,000/-</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,500/-</td>\n</tr>\n<tr>\n<td>Faculty / Delegate</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,000/-</td>\n<td>Rs.11,000/-</td>\n</tr>\n<tr>\n<td>Accmp. Person (Above 5 yrs)</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n</tr>\n<tr>\n<td>International Delegate</td>\n<td>USD 450</td>\n<td>USD 500</td>\n<td>USD 550</td>\n</tr>\n</tbody>\n</table>\n<p style="font-family: myfont; font-size: 18px;"><a href="http://www.pedosphere.in/register" target="_blank">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Dr. Swaranjit Singh Gambhir</p>\n<p style="font-family: myfont; font-size: 18px;">Organising Secretary</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919827067994">+91 9827067994</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:dentistssgambhir@gmail.com">dentistssgambhir@gmail.com</a></p>', '', '<a href="geo:15.48638,73.809315?q=15.48638,73.809315(MARRIOT RESORTS),z=18">Marriot Resorts</a>', 'Goa', '15.48638', '73.809315', 1),
(4, 'Mega Dental show', 'EXPO', 'The Dental Industry and trade being linked with the Dental profession the Association should endeavor to create awareness in the Dental profession of the latest trends and techniques available in the fields. The Association may act as a mediator in the settlement of disputes arising between the members and others related to the Dental Profession. The Association may become a member of other Association or Organization having objects similar to those of the Association or to enter into any agreement with them as may be thought advisable in the interest of the Association or its members with the approval of the General Body.', '', '2017-08-12', '2017-08-13', 'Free Entry', '', '', '<p style="font-family: myfont; font-size: 18px;">Organising Secretary</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919884724553">+91 9884724553</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:tdtma.chennai@gmail.com">tdtma.chennai@gmail.com</a></p>', '', 'Hall No 2, Chennai Trade Centre, Nadambakkam, Chennai', 'Chennai', '', '', 1),
(5, 'Expodent Chandigarh', 'EXPO', '', '', '2017-09-02', '2017-09-03', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href= "http://www.aditidental.co.in/registeration-form/">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Mr. Amitabh Sachdeva</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919814012424">+91 9814012424</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:sahiba@unicorndenmart.com">sahiba@unicorndenmart.com</a></p>', '', '', 'Chandigarh (PB)', '', '', 1),
(6, 'Famdent show', 'EXPO', 'Famdent is known for very lively and vibrant Trade Exhibition. National and International Exhibitors have used Famdent Shows to their advantage and found the perfect platform to sell and display their products, equipment and services. Several exhibitors have used Famdent Show as a launch platform for new products. Famdent Shows hold annual events in Mumbai and vary between other cities in India during the rest of the year. Conceptualized and executed as per International Dental Events, the Famdent Shows have captured a sizeable market and attained a leadership position among the Dental fraternity in India as well as some international Dentists. Famdent Shows cover the entire gamut of Dentistry that a visiting Dentist would hope for: Hands-On Courses and Workshop, Live Dental Procedures, Continuing Dental Education, Scientific Sessions by reputed national and international speakers, Dental Exhibition / Trade Show with extensive participation including top international brands in Oral Hygiene & Dentistry.', '', '2017-09-09', '2017-09-10', '', '', '<p style="font-family: myfont; font-size: 18px;">Registration Fees - Rs 700</p>', '<p style="font-family: myfont; font-size: 18px;">Dr. Anil Arora</p>\n<p style="font-family: myfont; font-size: 18px;">Chief Organiser</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+9198210 84470">+91 98210 84470</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:famdentindia@gmail.com">famdentindia@gmail.com</a></p>', '', '<a href="geo:17.414645,78.395032?q=17.414645,78.395032(JRC CONVENTION CENTRE),z=18">JRC Convention Centre, Jubilee Hills, Hyderabad, Telangana -500008</a>', 'Hyderabad', '17.414645', '78.395032', 1),
(7, '15th National Conference', 'CONFERENCE', '', '', '2017-09-09', '2017-09-11', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://www.iafobengaluru2017.com/registration-details.php">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Dr. Deepak V</p>\n<p style="font-family: myfont; font-size: 18px;">Conference Secretariat</strong></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+917411184210">+91 7411184210</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:iafo2017bengaluru@gmail.com">iafo2017bengaluru@gmail.com</a></p>', '', '', '', '12.966077', '77.598817', 1),
(8, '39th ISPPD National Conference', 'CONFERENCE', 'Interdisciplinary Pediatric Dentistry as per the conference theme – the preconference and scientific committees are developing conscientious program that integrates distinguished academicians and scholars across the globe with a balance between the youth and experience as well as academics and clinical practice. There will be an amalgamation of scientific presentations and panel discussions related to various branches of dentistry as well as pediatric and adolescent medicine. Efforts are being made to showcase the latest materials and technology for clinical practice management in the conference trade. Pedosphere is the name chosen for this conference with the intention to create a wonderful atmosphere to share and learn more and more Pediatric Dentistry. The scientific theme "Interdisciplinary Pediatric Dentistry" is chosen to unleash all the horizons of integrated Pediatric Dentistry. Pedosphere aims to expand the scope of Pediatric dentistry for the aspiring and existing child dentists. Hope this scientific gathering will be a platform to share, learn and debate that will impact the concepts of specialities within Pediatric Dentistry significantly.', '', '2017-09-13', '2017-09-16', '', '', '<table border="1" width="" cellspacing="0" cellpadding="5">\n<tbody>\n<tr>\n<td width="">Category</td>\n<td width="">From 1st Nov&rsquo; 16 to 30th Apr 17</td>\n<td width="">From 1st May to 25th Aug 17</td>\n<td width="">Spot Registration</td>\n</tr>\n<tr>\n<td>Student Delegate</td>\n<td>Rs.9,000/-</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,500/-</td>\n</tr>\n<tr>\n<td>Faculty / Delegate</td>\n<td>Rs.9,500/-</td>\n<td>Rs.10,000/-</td>\n<td>Rs.11,000/-</td>\n</tr>\n<tr>\n<td>Accmp. Person (Above 5 yrs)</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n<td>Rs.5,500/-</td>\n</tr>\n<tr>\n<td>International Delegate</td>\n<td>USD 450</td>\n<td>USD 500</td>\n<td>USD 550</td>\n</tr>\n</tbody>\n</table>\n<p style="font-family: myfont; font-size: 18px;"><a href="http://www.pedosphere.in/register" target=_blank>Register Here</a></p>', '', '', '<a href="geo:13.039209,80.142012?q=13.039209,80.142012(SRI RANCHANDRA UNIVERSITY),z=18">Sri Ranchandra University, Chennai</a>', 'Chennai', '13.039209', '80.142012', 1),
(9, '24th National conference', 'CONFERENCE', 'Indian Society of Oral Implantologists organizes 23rd National Conference and the theme of this year’s conference is "Dentistry & Oral Care: A vision for Excellence" which will provide an international  platform for discussion of present and future challenges in oral health, dental education, continuing education and expertise meeting.', '', '2017-09-21', '2017-09-24', '', '', '', '<p style="font-family: myfont; font-size: 18px;">Dr. Ramesh Chowdhary</p>\n<p style="font-family: myfont; font-size: 18px;">Organising Secretary</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919845206898">+91 9845206898</a></p>', '', 'Branemark Osseointegration Center India (Bangalore). No.3, 21st Main Road, Siddeshwarnagar, Marenahalli Behind Maruthi Mandir, Vijaynagar, Bangalore - 40\n<br>\n<br><a href="geo:12.967719,77.533394?q=12.967719,77.533394(BRANEMARK),z=18">Directions</a>', 'Bangalore', '12.967719', '77.533394', 1),
(10, '30th Annual Conference Indian Society for Dental Research (IADR India Division)', 'CONFERENCE', 'ISDR keeping in mind the theme of the conference “RESEARCH TO REALITY” present meaningful research that has had clinical impact and benefited the profession at large. Post Graduate students from across all specialties can attend. Conference would be a unique opportunity for these budding specialists as it would provide them a platform to show case their original research. This would give a boost to inter disciplinary research. A range of pre-congress courses are being planned for the same day. This closed group interaction would help the participants to learn new techniques and communicate directly with the mentors. We are in the process of compiling an elaborate and truly stimulating scientific programme, which we are sure, would satisfy your intellectual appetite.', '', '2017-09-30', '2017-10-02', '', '', '', '<p style="font-family: myfont; font-size: 18px;">Dr. Ajay Logani</p>\n<p style="font-family: myfont; font-size: 18px;">Conference Secretariat</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919818936926">+91 9818936926</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:isdr2017@gmail.com">isdr2017@gmail.com</a></p>', '', '<a href="geo:28.569102,77.185302?q=28.569102,77.185302(HYATT REGENCY),z=18">Hotel Hyatt Regency, New Delhi</a>', 'New Delhi', '28.569102', '77.185302', 1),
(11, 'World Dental show', 'EXPO', 'WDS is also a trade and knowledge sharing platform that delivers the latest technologies, cutting-edge research and dentistry techniques to meet the growing demands of the ever-evolving world of dental science. xperience hands-on training, workshops and demonstrations that will help you reap rewards in your professional career. Exhibitors can also benefit from the show as it attracts a high percentage of private dentists, practice and laboratory owners who have the resource and authority to make better decisions to purchase dentistry-related products and equipment.', '', '2017-10-06', '2017-10-08', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://wds.org.in/content/freeentry.aspx?type=Reg">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">WDS Secretariat</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+912243434545">+91 2243434545</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:info@wds.org.in">info@wds.org.in</a></p>', '', '<a href="geo:19.069318,72.866985?q=19.069318,72.866985(BANDRA-KURLA COMPLEX),z=18">Bandra-Kurla complex, Mumbai</a>', 'Mumbai', '19.069318', '72.866985', 1),
(12, 'Expodent Mumbai', 'EXPO', '', '', '2017-10-17', '0000-00-00', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://www.aditidental.co.in/registeration-form/">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Mr. Milind Mirashi</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919822793001">+91 9822793001</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:sahiba@unicorndenmart.com">sahiba@unicorndenmart.com</a></p>', '', '', 'Goregaon', '', '', 1),
(13, '52nd Indian Orthodontic Conference', 'CONFERENCE', 'Our aim is to bring all the newer technologies and ideas that are introduced across the globe on a common platform. Eminent speakers from India and Abroad would be participating and will be sharing their experience, expertise, and their latest research. 52nd IOC will provide an ideal forum to enhance your knowledge base.', '', '2017-11-17', '2017-11-19', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://in.eregnow.com/ticketing/register/52ndIOC2017">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Dr. Balvinder Singh Thakkar</p>\n<p style="font-family: myfont; font-size: 18px;">Conference Secretariat</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919672472222">+91 9672472222</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:52ndioc@gmail.com">52ndioc@gmail.com</a></p>', '', '<a href="geo:26.906072,75.8057?q=26.906072,75.8057(BM BIRLA AUDITORIUM ),z=18">BM Birla Auditorium</a>', 'Jaipur', '26.906072', '75.8057', 1),
(14, 'Expodent Bangalore', 'EXPO', '', '', '2017-11-17', '0000-00-00', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://www.aditidental.co.in/registeration-form/">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;">Dr. B.S. Shetty</p>\n<p style="font-family: myfont; font-size: 18px;"><a href="tel:+918025984756">+91 8025984756</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:sahiba@unicorndenmart.com">sahiba@unicorndenmart.com</a></p>', '', 'Bangalore International Exhibition Center , Tumkur Road ,Bangalore', 'Bangalore', '', '', 1),
(15, '32nd IACDE and 25th IES national Conference, Ahmedabad', 'CONFERENCE', 'IACDE and IES organising scientific programme adorned by national and international speakers and leading experts in the filed of Conservative dentistry and endodontics which will cover every aspect of our speciality and provide new insights into basic sciences, clinical research and therapeutic interventions along with newer innovations. Scientific papers and posters will encourage an interactive exchange of new ideas, tips and tricks between participants. A trade fiesta comprising all leading brands who will showcase their latest products and services is also planned.\n', '', '2017-11-23', '2017-11-26', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://www.iacdeies2017.com/registration%20details.html">Register Here</a></p>', ' <p style="font-family: myfont; font-size: 18px;">Dr. Shikha Kanodia - <a href="&quot;tel:+919825465861">+91 9825465861</a></p>\n<p style="font-family: myfont; font-size: 18px;">Organizing secretary</p>\n<p style="font-family: myfont; font-size: 18px;">Dr.Girish Parmar - <a href="&quot;tel:+919426006569">+91 9426006569</a></p>\n<p style="font-family: myfont; font-size: 18px;">Organizing chairman</p>', '', '<a href="geo:23.231704,72.633759?q=23.231704,72.633759(MAHATMA MANDIR CONVENTION CENTRE ),z=18">Mahatma Mandir Convention Centre, Gandhinagar, Gujarat</a>', 'Gujarat', '23.231704', '72.633759', 1),
(16, 'World Congress and Expo Dentristry and Oral Health', 'EXPO', 'WCEDOH -2017 will focus on discussing “Dentistry: A source for beautiful smile” for the three days and the conference will incorporate keynote speeches, plenary sessions, poster and oral presentations. We anticipate an energizing meeting in December 2017 that guarantees great scientific debate, incredible logical level headed discussion and pleasant social collaboration. This conference points on discussing recent trends that explore the diverse research and applications of Dentistry and Oral Health. WCEDOH -2017 is the finest podium for Dentistry Researchers, Oral Health Experts, Research institutes, Dental doctors, Investors and Industry stakeholders to meet, associate and discuss current industry inclines and build up business associations.', '', '2017-12-07', '2017-12-09', '', '', '<p style="font-family: myfont; font-size: 18px;"><a href="http://dentalscienceconferences.com/register-now/">Register Here</a></p>', '<p style="font-family: myfont; font-size: 18px;"><a href="tel:+919182277464">+91 9182277464</a></p>\n<p style="font-family: myfont; font-size: 18px;"><a href="mailto:wcedoh@dentalscienceconferences.com">wcedoh@dentalscienceconferences.com</a></p>', '', 'Goa', 'Goa', '', '', 1),
