INSERT INTO `tbl_organisers` (`orgnsr_id`, `orgnsr_name`, `orgnsr_description`, `orgnsr_website`, `orgnsr_trusted`) VALUES
(1, 'AOI (Academy of Oral Implantology)', '', '', 0),
(2, 'IPS (Indian Prosthodontics Society)', 'The Indian Prosthodontic Society in now emerging to play a leading role in promoting total Prosthodontic Rehabilitation in the country in this new century. The idea was first mooted to start a society of Prosthodontists in India by Dr. F.D. Mirza at a informal dinner party hosted by him at his residence and a AADHOC committee was formed comprised of Dr. T.M. Udani, Dr. F.D. Mirza and Dr. K. Bhargava. Also, it was decided to give vide publicity through newspapers to invite all the dental surgeons in India interested in Prosthetic Dentistry to attend Indian Dental Association Annual Conference to be held in Ahmedabad in 1973. In this meeting the Indian Prosthodontic Society was officially formed. The IPS constitution was framed and accepted. Three office bearers were unanimously elected by the committee which was formed in Ahmedabad. They were Dr. T.M.Udani, Founder President, Dr. F.D. Mirza, founder Secretary-cum-Treasurer and Dr.K. Bhargava as the Editor of our Journal. The first scientific conference of IPS was held at Madras, where Dr. E.G.R. Solomon, was the dynamic force in organising the conference.', '', 0),
(3, 'IAACD (Indian Academy of Aesthetic and Cosmetic Dentistry)', 'IAACD, the face of Aesthetic Dentistry in India, is an association of dentists with a clear cut focus on aesthetic & cosmetic dentistry. It has been in existence for over two decades and is recognized internationally, being part of the International Federation of Esthetic Dentists (IFED). Since "Aesthetic Dentistry" is not a part of the general dental curriculum, IAACD strives to bring the latest in this field to educate the dental fraternity and more so its members. The vision of Dr. Sandesh Mayekar (Founder President) and Dr.A.Kumarswamy (Founder Secretary) saw the launch of the IAACD way back in 1991 on the 10th of August in Goa. There has been no looking back since then. IAACD has been instrumental in bringing international aesthetic dentistry to the shores of India every year. Almost every leading luminary of the Aesthetic Dental world has come to India, deliberated, delivered and contributed in the annual conferences of the IAACD.', '', 0),
(4, 'ADITI (Association of Dental Industry and Trade of India)', 'ADITI can be traced back to the vision of a group of dental professionals who envisioned a fresh and dynamic environment in India’s dental scenario, in line with the global trends where trade barriers are no longer extant and where science and technology rules the roost. A forum like ADITI where manufacturers, traders, importers and all others connected with the dental trade fulfilled a vital gap in the link between dental practitioners, academia, manufacturers and traders, apart from giving voice to the aspirations of all in representations and discussions with the Government.ADITI has made rapid strides in establishing itself as a respected, responsible and dependable body. Of course, this growth has had its share of troubles and heartburns, but it has triumphantly overcome all obstacles to stand today as a premier body of dental trade professionals.', '', 0),
(5, 'Famdent', 'Founded by Dr. Anil Arora in 1999 as a publication on Clinical Dentistry based on international standards, FAMDENT now has multiple offerings with a strong foothold in the Indian Dental Industry. FAMDENT ventures include Famdent Shows, Famdent Publications, Famdent Awards, Corporate Solutions & more – a brand of repute that now resonates with almost every Dentist in the country.', '', 0),
(6, 'ISPPD (Indian Society of Pedodontics and Preventive Dentistry Conference)', 'The Indian Society of Pedodontics and Preventive Dentistry (ISPPD) is a national society specifically concerned with the oral health of children in India. It aims to improve oral health in children and encourage the highest standards of clinical care. ISPPD has over 1400 life members from University, Pediatric Dental Departments, Pediatric Dental Practice and General Dental Practice.', '', 0),
(7, 'ISOI (Indian Society of Oral Implantologists)', 'A study group called, Bombay Society of Oral Implantologists (BSOI), was formed in 1988, by a few eminent dentists in Mumbai who were interested in dental implantology. As implantology began to attract the attention of more and more dentists, it''s membership grew. BSOI was changed to Indian Society of Oral Implantologists (ISOI) in 1993 and the society became a national body. In 1995, ISOI obtained the affiliation of the International Congress of Oral Implantologists (ICOI), USA.', '', 0),
(8, 'ISDR (Indian Society for Dental Research)', 'ISDR has held nearly 28 annual conferences in different parts of the country. The society owes its origin to Dr. M. Rahmatulla, founder president who conceived the formation of the society when he attended the IADR 64th annual session in Dallas, Texas in March 1984. At the instance of the then president of IADR Dr. Robert frank of France, IADR (Indian Division) was conceived at the opening ceremony. The founder set the ball in motion to establish IADR section in INDIA. After 2 years of continuous efforts, finally the convention of the society was held in July 1986 at Hotel Connemara in Madras. The convener Dr. M. Rahmatulla was unanimously elected as the founder president of the IADR Indian Division. Among others, DR. J.G. Kannapan, Dr. P.K. Baskar played a major role in the establishment of the organization. We aim to promote advancement of dental research in India. Our annual international conferences highlight cutting-edge research in dentistry.', '', 0),
(9, 'IDA (Indian Dental Association)', 'The Indian Dental Association (IDA) is an authoritative, independent and recognized voice of dental professionals in India. We are committed to public oral health, ethics, science and advancement of dental professionals through its initiatives in advocacy, education, research and development of standards. Our mission is improve the oral health of the public by innovation in education, training, research, advocacy and related programmes. This translates into a commitment for dental excellence. Therefore, IDA is dedicated to supporting dental professionals in their practice by enhancing, updating skills and knowledge.', '', 0),
(10, 'IOC (Indian Orthodontic Conference)', 'The Indian Orthodontic Society a 6000 plus strong professional Society is the first Speciality society in Dentistry in India.\nThe IOS started as a Study Group in Bombay, now Mumbai, way back in the year 1963 and was formally established as the INDIAN ORTHODONTIC SOCIETY on Friday the 5th October 1965.  The Indian Orthodontic Society held it''s first Conference in the year 1967 at New Delhi with a scientific session.', '', 0),
(11, 'IACDE (INDIAN ASSOCIATION OF CONSERVATIVE DENTISTRY AND ENDODONTICS) & IES (Indian Endodontic Society)', 'IACDE (INDIAN ASSOCIATION OF CONSERVATIVE DENTISTRY AND ENDODONTICS)\nIndian Association of Conservative Dentistry and Endodontics provides Life membership to all those who hold Post Graduate qualification in the speciality of Conservative Dentistry & Endodontics and Associate membership to other specialities, recognised by the Dental Council of India.\nIES (Indian Endodontic Society)\nThe Indian Endodontic Society (IES) just completed its 26 years of glorious existence and along with it “Endodontology” its 25th year of continuous publication. Its aim to organize scientific meetings, seminars at periodic intervals on Conservative Dentistry and Endodontics with specialisation in the subject concerned in India and abroad, to create a web of awareness in public interest and enriching society by quicker and better amenities and conveying preventive measures.', '', 0),
(12, 'Conference Era', 'Conference Era is initiated to organize international scientific and technological conferences globally with an idea to arrange face to face interaction between expertises and researchers working in same fields or in interdisciplinary research. Our object is to address the aggregate objectives of academic group, particularly in trading the thoughts which encourages development of research and science. The conferences organized by Conference Era covers a wide series of subjects like Science, Technology, Medical, Pharma, Clinical and Engineering. Conference Era endorse the exchange of pioneering thoughts, promoting scientific discussions and the free exchange of innovative debates among attendees and participants. We encourage all researchers, students including post docs and graduate students, to attend the conferences in their respective research field.', '', 0),
(13, 'IAOF(The Indian Association of Forensic Odontology)', 'In August 1986 Prof J G Kannappan from Madras Dental College and Prof P Chandra Sekharan from Forensic Sciences Department conducted the first National Workshop on Forensic Odontology at Chennai. Resource persons for the workshop were experts like Dr Kenneth Brown from Adelaide University, Australia and from Japan. Dental surgeons and forensic scientists numbering about forty were given training in forensic odontology. This led to solving of a few crimes using dental evidences.The next major event in Forensic odontology in India was an International Conference on Forensic odontology which was also conducted at Chennai during 23rd to 25th January 1998 at Hotel Savera. It was organised under the auspices of the Indian Society for Dental Research by Prof J. G. Kannappan as the Chairman and Dr S. Balagopal as the organising secretary.', '', 0),
(14, 'TNDTMA(Tamilnadu Dental Traders and Manufacture Association)', 'Tamilnadu Dental Traders and Manufacture Association and Organizing Committee of "Dental Show" to be held at Chennai on 12th and 13th of August 2017.', '', 0),
(16, 'Dr. Cyrus Karkaria', 'Dr. Cyrus Karkaria is a Dentist, Implantologist and Cosmetic/Aesthetic Dentist in Peddar Road, Mumbai. Dr. Cyrus Karkaria practices at Sparkle Dental Care in Peddar Road, Mumbai. He completed MSc - Master of Oral Implantology (MOI) from Frankfurt University, Germany.\n', '', 0),
(19, 'Dentartz Dental Academy', '', '', 0),
(20, 'Dr. Rahul N. Shah', 'Dr. Rahul Shah has completed his BDS from Daramsinh Desai University, Nadiad during 2005-2010. He has Persued his post graduation in Periodontology, Implantology & Laser surgery.', '', 0),
(21, 'Dr Niti Shah', 'Dr. Niti Shah Nagrath is a Dentist, Endodontist and Cosmetic/Aesthetic Dentist in Chembur, Mumbai and has an experience of 5 years in these fields. Dr. Niti Shah Nagrath practices at The Dental House in Chembur, Mumbai. She completed MDS Esthetic dentist and Endodontis from Seema Dental College Hospital in 2015 and BDS from Seema Dental College Hospital in 2011.She is a member of Indian academy of conversation dentistry and endodontics.', '', 0),
(22, 'Dr. Rajat Bhandari', '', '', 0),
(23, 'ICODE(International Center of Dental Excellence)', 'ICODE Pvt. Ltd. has coined a up-to-the minute approach to keep a velocity with fast growing world, by thorough selection of modules where protocols are set for remarkable learning. The modules are designed to provide hands on training enriched with live demonstration under most sort after mentors.', 'http://www.icodeindia.in/home.html', 0),
(24, 'The Implant Academy', 'We aim to impart world class training in Advanced Implant Dentistry to boost your confidence and get you office ready! The Implant Academy invites implantologists of International repute to give a personalized training, enabling both fresh graduates and practicing dentists to effortlessly place dental implants in their day to day practice.', 'www.theimplantacademy.in', 0),
(26, 'Dr. Moez I. Khakiani', 'Mr. Moez Khakiani is a Prosthodontist in Thane West, Thane. Mr. Moez Khakiani practices at Dent-O-Care. in Thane West, Thane and Dent O Care in Bandra West, Mumbai. He completed MDS.\n', '', 0),
(27, 'Trinity Dentofacial Asthetic Dentristry', 'Academy for Training Health Care Professionals in Dentistry, Facial Cosmetics and Tricology', '', 0),
(30, 'Dr. Varsha Rao', 'Dr. K.Varsha Rao Started Om dental care and implant center in 1999 and has been in private practice since then. Has special interest in endodontics (root canal treatment) and cosmetic and implant dentistry. ', '', 0);
